// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "../interfaces/ISwapManager.sol";

contract MockRelayer {
    ISwapManager public swapManager;

    // Events to track relayer actions
    event OrderReceived(
        bytes32 indexed orderId,
        address indexed initiator,
        address tokenIn,
        address tokenOut,
        uint256 amountIn,
        uint256 amountOutMin,
        bytes32 secretHash
    );

    event OrderFulfilled(
        bytes32 indexed orderId,
        address indexed resolver,
        uint256 amountOut,
        bytes32 secret
    );

    constructor(address _swapManager) {
        swapManager = ISwapManager(_swapManager);
    }

    // Simulate receiving an order from a user
    function receiveOrder(
        address tokenIn,
        address tokenOut,
        uint256 amountIn,
        uint256 amountOutMin,
        uint256 deadline,
        bytes32 secretHash
    ) external payable returns (bytes32) {
        // Transfer tokens from the user to this contract first
        if (tokenIn != address(0)) {
            IERC20(tokenIn).transferFrom(msg.sender, address(this), amountIn);
            // Approve the swap manager to spend the tokens
            IERC20(tokenIn).approve(address(swapManager), amountIn);
        }

        // Create the order in the swap manager
        bytes32 orderId = swapManager.createOrder{
            value: tokenIn == address(0) ? amountIn : 0
        }(
            tokenIn,
            tokenOut,
            amountIn,
            amountOutMin,
            deadline,
            secretHash
        );

        emit OrderReceived(
            orderId,
            msg.sender,
            tokenIn,
            tokenOut,
            amountIn,
            amountOutMin,
            secretHash
        );

        return orderId;
    }

    // Simulate a resolver fulfilling an order
    function fulfillOrder(
        bytes32 orderId,
        uint256 amountOut,
        bytes32 secret
    ) external payable {
        // Forward any ETH sent with the transaction to the swap manager
        (bool success, ) = address(swapManager).call{value: msg.value}(
            abi.encodeWithSignature(
                "fulfillOrder(bytes32,uint256,bytes32)",
                orderId,
                amountOut,
                secret
            )
        );
        require(success, "Fulfill order failed");
        emit OrderFulfilled(orderId, msg.sender, amountOut, secret);
    }
}

