pragma solidity ^0.8.20;

interface ISwapManager {
    struct SwapOrder {
        address initiator;
        address resolver;
        uint256 amountIn;
        uint256 amountOutMin;
        address tokenIn;
        address tokenOut;
        uint256 deadline;
        bytes32 secretHash;
        bool isFulfilled;
        bool isRefunded;
    }

    event OrderCreated(
        bytes32 indexed orderId,
        address indexed initiator,
        address tokenIn,
        address tokenOut,
        uint256 amountIn,
        uint256 amountOutMin,
        bytes32 secretHash
    );

    event OrderFulfilled(
        bytes32 indexed orderId,
        address indexed resolver,
        bytes32 secret
    );

    event OrderRefunded(bytes32 indexed orderId);

    function createOrder(
        address tokenIn,
        address tokenOut,
        uint256 amountIn,
        uint256 amountOutMin,
        uint256 deadline,
        bytes32 secretHash
    ) external payable returns (bytes32);

    function fulfillOrder(
        bytes32 orderId,
        uint256 amountOut,
        bytes32 secret
    ) external payable;

    function refundOrder(bytes32 orderId) external;

    function registerWorkerWallet(address workerWallet) external;

    function getOrder(bytes32 orderId) external view returns (
        address initiator,
        address resolver,
        uint256 amountIn,
        uint256 amountOutMin,
        address tokenIn,
        address tokenOut,
        uint256 deadline,
        bytes32 secretHash,
        bool isFulfilled,
        bool isRefunded
    );

    /**
     * @notice Register a worker wallet that can be used to fulfill orders
     * @param workerWallet The address of the worker wallet to register
     */
}
