    function createOrder(
        address tokenIn,
        address tokenOut,
        uint256 amountIn,
        uint256 amountOutMin,
        uint256 deadline,
        bytes32 secretHash
    ) external payable returns (bytes32);

    function fulfillOrder(
        bytes32 orderId,
        uint256 amountOut,
        bytes32 secret
    ) external payable;

    function refundOrder(bytes32 orderId) external;

    function registerWorkerWallet(address workerWallet) external;

    function getOrder(bytes32 orderId) external view returns (
        address initiator,
        address resolver,
        uint256 amountIn,
        uint256 amountOutMin,
        address tokenIn,
        address tokenOut,
        uint256 deadline,
        bytes32 secretHash,
        bool isFulfilled,
        bool isRefunded
    );

    /**
